import React from 'react'
import namedb from './names'



const App = () => {
  return (
    <div>
        <ul>
              {namedb.names.map(n => (
                  <li key={n.name}>
                      {n.name} {n.amount}
                  </li>
              ))}
        </ul>
    </div>
  )

}

export default App
